"use strict";(globalThis.webpackChunkmy_website=globalThis.webpackChunkmy_website||[]).push([[719],{5603:(e,n,i)=>{i.r(n),i.d(n,{assets:()=>l,contentTitle:()=>r,default:()=>h,frontMatter:()=>s,metadata:()=>t,toc:()=>c});const t=JSON.parse('{"id":"the-ai-robot-brain/intro","title":"The AI-Robot Brain (NVIDIA Isaac): Simulation, Perception, and Navigation","description":"NVIDIA Isaac is a comprehensive platform designed to accelerate the development and deployment of AI-powered robots. It encompasses tools for simulation, perception, and navigation, tightly integrated to facilitate the entire robot development lifecycle. At its core lies Isaac Sim, a powerful robotics simulator built on NVIDIA Omniverse, which provides photorealistic rendering and physically accurate environments crucial for training and testing complex Physical AI systems.","source":"@site/docs/04-the-ai-robot-brain/01-intro.md","sourceDirName":"04-the-ai-robot-brain","slug":"/the-ai-robot-brain/intro","permalink":"/Physical-AI-Humanoid-Robotics-Course-Book/docs/the-ai-robot-brain/intro","draft":false,"unlisted":false,"editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/docs/04-the-ai-robot-brain/01-intro.md","tags":[],"version":"current","sidebarPosition":1,"frontMatter":{"sidebar_position":1},"sidebar":"tutorialSidebar","previous":{"title":"Robot Simulation (Digital Twin): Gazebo and Beyond","permalink":"/Physical-AI-Humanoid-Robotics-Course-Book/docs/robot-simulation/intro"},"next":{"title":"Humanoid Robot Development: Kinematics, Dynamics, and Control","permalink":"/Physical-AI-Humanoid-Robotics-Course-Book/docs/humanoid-robot-development/intro"}}');var a=i(4848),o=i(8453);const s={sidebar_position:1},r="The AI-Robot Brain (NVIDIA Isaac): Simulation, Perception, and Navigation",l={},c=[{value:"Isaac Sim Setup (approx. 500 words)",id:"isaac-sim-setup-approx-500-words",level:3},{value:"Synthetic Data Generation (approx. 500 words)",id:"synthetic-data-generation-approx-500-words",level:3},{value:"VSLAM Hardware Acceleration (approx. 500 words)",id:"vslam-hardware-acceleration-approx-500-words",level:3},{value:"Nav2 Path Planning (approx. 500 words)",id:"nav2-path-planning-approx-500-words",level:3}];function d(e){const n={code:"code",h1:"h1",h3:"h3",header:"header",li:"li",ol:"ol",p:"p",strong:"strong",ul:"ul",...(0,o.R)(),...e.components};return(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(n.header,{children:(0,a.jsx)(n.h1,{id:"the-ai-robot-brain-nvidia-isaac-simulation-perception-and-navigation",children:"The AI-Robot Brain (NVIDIA Isaac): Simulation, Perception, and Navigation"})}),"\n",(0,a.jsx)(n.p,{children:"NVIDIA Isaac is a comprehensive platform designed to accelerate the development and deployment of AI-powered robots. It encompasses tools for simulation, perception, and navigation, tightly integrated to facilitate the entire robot development lifecycle. At its core lies Isaac Sim, a powerful robotics simulator built on NVIDIA Omniverse, which provides photorealistic rendering and physically accurate environments crucial for training and testing complex Physical AI systems."}),"\n",(0,a.jsx)(n.h3,{id:"isaac-sim-setup-approx-500-words",children:"Isaac Sim Setup (approx. 500 words)"}),"\n",(0,a.jsx)(n.p,{children:'Isaac Sim is NVIDIA\'s next-generation robotics simulation platform, built on the NVIDIA Omniverse\u2122 platform. Omniverse is a scalable, multi-GPU real-time simulation and collaboration platform for 3D production pipelines. What this means for robotics is an unparalleled level of visual and physical fidelity in simulated environments, which is critical for reducing the "sim-to-real" gap. The setup for Isaac Sim involves several key components, often requiring a robust computing environment due to its demanding nature, particularly the GPU requirements.'}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Hardware Requirements"}),": To run Isaac Sim effectively, especially for complex scenes and high-fidelity sensor simulations, a powerful GPU is essential. NVIDIA recommends professional-grade GPUs, but consumer-grade cards like the ",(0,a.jsx)(n.strong,{children:"RTX 4070 Ti/4090"})," are often capable of running smaller to medium-sized simulations. The more complex the scene (more assets, advanced physics, higher resolution sensors), the more demanding the computational and graphical load. This powerful GPU is not just for rendering; it accelerates physics computations, AI model inference within the simulation, and synthetic data generation. For deploying trained models to actual robots, especially at the edge, platforms like the ",(0,a.jsx)(n.strong,{children:"NVIDIA Jetson Orin Nano"})," become relevant, acting as the robot's on-board brain, capable of running optimized AI models."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Installation"}),": Isaac Sim is typically installed via the NVIDIA Omniverse Launcher. This launcher manages Omniverse Nucleus (for collaborative scene description and asset management), various Omniverse applications, and connectors. Once Omniverse is installed, Isaac Sim can be added as an application. It leverages USD (Universal Scene Description) as its core data format, allowing for interoperability with various 3D tools and asset pipelines."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Project Structure"}),": Within Isaac Sim, a robotics project often consists of:"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Worlds"}),": USD files defining the environment, including lighting, ground planes, obstacles, and props. These can be imported from various CAD software or built directly within Omniverse."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Robots"}),": USD files describing the robot's links, joints, sensors, and actuators. These are typically imported from URDF or other robot description formats and converted to USD. For humanoids, accurately translating complex URDF descriptions into USD is a crucial step."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Sensors"}),": Virtual sensors (cameras, LiDAR, IMUs, force sensors) are added to the robot model or the environment. Isaac Sim's sensor models are highly configurable, allowing for realistic noise profiles and output formats, mimicking real-world hardware like the ",(0,a.jsx)(n.strong,{children:"Intel RealSense D435i"})," depth camera."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Extensions"}),": Isaac Sim is highly modular, built on an extension framework. Developers can create custom Python extensions to add new functionalities, such as custom robot controllers, task definitions, or UI elements."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Integration with ROS 2"}),": Isaac Sim provides robust integration with ROS 2 (Robot Operating System 2). This allows developers to control simulated robots using ROS 2 nodes, publish sensor data from the simulator to ROS 2 topics, and subscribe to ROS 2 commands to actuate the robot. This seamless integration means that code developed and tested in Isaac Sim (e.g., navigation stacks, manipulation planners) can be directly transferred to physical robots running ROS 2. The connection is typically managed through specific ROS 2 bridges and extensions within Isaac Sim."]}),"\n",(0,a.jsx)(n.p,{children:"A key aspect of Isaac Sim's design is its focus on extensibility and Python scripting. Almost every aspect of the simulation can be controlled and automated through Python APIs, making it ideal for scripting complex scenarios, automated testing, and large-scale synthetic data generation."}),"\n",(0,a.jsx)(n.h3,{id:"synthetic-data-generation-approx-500-words",children:"Synthetic Data Generation (approx. 500 words)"}),"\n",(0,a.jsx)(n.p,{children:"Synthetic data generation is a transformative technique in AI for robotics, addressing one of the most significant bottlenecks in machine learning: the need for vast quantities of labeled data. Collecting and annotating real-world data from robots is expensive, time-consuming, and often impractical, especially for rare events or hazardous scenarios. Isaac Sim, with its photorealistic rendering and physics engine, is an ideal platform for generating high-quality synthetic data."}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"The Data Challenge"}),": Training robust deep learning models for perception tasks (e.g., object detection, semantic segmentation, pose estimation) requires massive, diverse datasets. If a model is only trained on data from a few specific environments or lighting conditions, it will generalize poorly to unseen scenarios. Real-world data collection is limited by environment accessibility, safety, and the tedious manual process of annotation. Imagine manually labeling every pixel in thousands of images for semantic segmentation or precisely marking 3D bounding boxes for every object."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"How Synthetic Data Helps"}),": Synthetic data is artificially created data that mimics real-world data but comes with perfect, pixel-accurate ground truth labels generated automatically by the simulator. This eliminates the manual annotation burden entirely. Isaac Sim can generate:"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"RGB Images"}),": Photorealistic images under various lighting conditions, textures, and camera angles."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Depth Maps"}),": Precise depth information for every pixel, invaluable for recreating data from sensors like the ",(0,a.jsx)(n.strong,{children:"Intel RealSense D435i"}),"."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Semantic Segmentation Masks"}),': Each object type (e.g., "robot arm," "table," "cup") is assigned a unique color, providing perfect segmentation.']}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Instance Segmentation Masks"}),': Each individual object instance (e.g., "cup A," "cup B") is uniquely identified.']}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Bounding Boxes (2D and 3D)"}),": Accurate bounding boxes around objects."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Camera Parameters"}),": Intrinsic and extrinsic camera matrices."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"LiDAR Point Clouds"}),": Simulated point clouds with configurable noise."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Domain Randomization"}),": A critical technique in synthetic data generation is ",(0,a.jsx)(n.strong,{children:"Domain Randomization (DR)"}),'. DR involves randomizing various aspects of the simulation environment (e.g., textures, lighting, object positions, camera angles, physical properties) to force the AI model to learn robust features rather than overfitting to specific visual cues in the synthetic data. The goal is to make the simulated data so diverse that the real world appears as just another variation within the simulated distribution. This helps bridge the "sim-to-real" gap. For example, instead of collecting thousands of images of a specific "red cup" in various real-world settings, Isaac Sim can render millions of images of cups with randomized colors, textures, lighting, and backgrounds, automatically generating all necessary labels.']}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Benefits"}),":"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Scale"}),": Generate virtually unlimited amounts of diverse data quickly and cheaply. Powerful GPUs like the ",(0,a.jsx)(n.strong,{children:"RTX 4070 Ti/4090"})," are instrumental here, allowing for rapid rendering and data throughput."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Ground Truth"}),": Perfect, pixel-accurate ground truth labels are automatically available."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Safety"}),": Test scenarios that are dangerous or impractical in the real world (e.g., robot failures, extreme environments)."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Diversity"}),": Easily create data for rare events or under-represented categories."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Iterative Improvement"}),": Rapidly iterate on data generation parameters to improve model performance."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:["Synthetic data, especially when combined with domain randomization, significantly reduces the need for real-world data collection, accelerating the development of robust perception models for Physical AI applications, particularly those deployed on edge devices like the ",(0,a.jsx)(n.strong,{children:"NVIDIA Jetson Orin Nano"}),"."]}),"\n",(0,a.jsx)(n.h3,{id:"vslam-hardware-acceleration-approx-500-words",children:"VSLAM Hardware Acceleration (approx. 500 words)"}),"\n",(0,a.jsx)(n.p,{children:"Visual Simultaneous Localization and Mapping (VSLAM) is a core component of robot perception, allowing a robot to build a map of an unknown environment while simultaneously tracking its own position within that map. For Physical AI systems, especially mobile robots and humanoids, VSLAM is fundamental for autonomous navigation, object interaction, and maintaining a coherent understanding of the operational space. The computational intensity of VSLAM algorithms, particularly those relying on complex visual feature extraction and optimization, often necessitates hardware acceleration for real-time performance."}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"VSLAM Fundamentals"}),": VSLAM algorithms typically involve several stages:"]}),"\n",(0,a.jsxs)(n.ol,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Feature Extraction"}),": Identifying salient points or features in camera images (e.g., SIFT, ORB, deep learning features)."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Feature Matching"}),": Matching features between consecutive frames to estimate camera motion."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Pose Estimation"}),": Calculating the camera's 3D position and orientation."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Map Building"}),": Augmenting a map with new feature locations."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Optimization (Bundle Adjustment/Graph Optimization)"}),": Refinining the estimated poses and map features over time to minimize errors."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"The Need for Acceleration"}),": These stages, particularly feature extraction and optimization, can be computationally intensive. For a robot to perform VSLAM in real-time, meaning it can update its pose and map at sensor frame rates (e.g., 30 Hz for a camera), these computations must be performed very quickly. This is where hardware acceleration, especially on NVIDIA platforms, plays a crucial role."]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"NVIDIA Hardware Acceleration"}),": NVIDIA provides a suite of tools and hardware optimized for VSLAM."]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"CUDA"}),": NVIDIA's parallel computing platform and programming model, which allows developers to leverage the power of GPUs for general-purpose computation. VSLAM algorithms can be heavily parallelized, making GPUs ideal for accelerating feature extraction, descriptor computation, and matrix operations involved in optimization."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"cuSLAM"}),": A library provided by NVIDIA specifically designed for accelerating various SLAM algorithms on GPUs. It offers highly optimized primitives for tasks like feature tracking, loop closure detection, and bundle adjustment."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Jetson Platform"}),": Edge AI platforms like the ",(0,a.jsx)(n.strong,{children:"NVIDIA Jetson Orin Nano"})," are designed for on-device AI inference and computer vision tasks. The Orin Nano features a powerful GPU (1.7 TOPS for AI) that can accelerate VSLAM pipelines, enabling robots to perform real-time localization and mapping directly on the robot. This is critical for applications where low latency and autonomy are paramount, as it reduces reliance on off-board computing or cloud resources. For example, the ",(0,a.jsx)(n.strong,{children:"Intel RealSense D435i"})," depth camera, when connected to a Jetson Orin Nano, can feed high-resolution depth and RGB data directly into a GPU-accelerated VSLAM pipeline."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Example Use Cases"}),":"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Autonomous Navigation"}),": A robot needs to know its precise location to navigate effectively. Real-time VSLAM provides this."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Object Manipulation"}),": For a humanoid robot to grasp an object, it needs an accurate 3D understanding of the object's position relative to its own end-effector, often provided by VSLAM-derived maps."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Human-Robot Collaboration"}),": Robots sharing a workspace with humans need robust localization to avoid collisions and understand their shared environment."]}),"\n"]}),"\n",(0,a.jsx)(n.p,{children:"The ability to perform VSLAM with hardware acceleration on platforms like the Jetson Orin Nano is a game-changer for Physical AI, enabling more capable and autonomous robots that can reliably operate in complex, unstructured environments without constant external supervision."}),"\n",(0,a.jsx)(n.h3,{id:"nav2-path-planning-approx-500-words",children:"Nav2 Path Planning (approx. 500 words)"}),"\n",(0,a.jsx)(n.p,{children:"Nav2 is the next-generation navigation stack for ROS 2, providing a robust and flexible framework for autonomous mobile robot navigation. It builds upon decades of research in robotics and leverages the modern capabilities of ROS 2, including its DDS-based communication and real-time capabilities. For humanoids and other complex Physical AI systems, Nav2 orchestrates the process of getting a robot from a starting pose to a goal pose while avoiding obstacles."}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Components of Nav2"}),": Nav2 is not a single monolithic algorithm but a collection of interconnected ROS 2 nodes, each responsible for a specific aspect of navigation. Key components include:"]}),"\n",(0,a.jsxs)(n.ul,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"World Model"}),": Built from sensor data (e.g., LiDAR, depth cameras like the ",(0,a.jsx)(n.strong,{children:"Intel RealSense D435i"})," for 2D/3D occupancy grids), this represents the robot's understanding of its environment. It's often maintained by the ",(0,a.jsx)(n.code,{children:"costmap_2d"})," plugin."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Localization"}),": The robot needs to know its position within the map. Nav2 typically uses ",(0,a.jsx)(n.code,{children:"AMCL"})," (Adaptive Monte Carlo Localization) or ",(0,a.jsx)(n.code,{children:"UKF"})," (Unscented Kalman Filter) based localization, often integrating data from VSLAM outputs or odometry."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Global Planner"}),": Given a start and goal pose, the global planner calculates a collision-free path through the entire known map. Common algorithms include ",(0,a.jsx)(n.code,{children:"Dijkstra's"})," or ",(0,a.jsx)(n.code,{children:"A*"})," search, which find optimal paths on a discretized grid."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Local Planner (Controller)"}),": This component takes the global path and the robot's current pose, and generates short-term, dynamically feasible trajectories to follow the global path while reacting to local obstacles (e.g., dynamic obstacles like moving humans). Algorithms like ",(0,a.jsx)(n.code,{children:"TEB"})," (Timed Elastic Band) or ",(0,a.jsx)(n.code,{children:"DWB"})," (Dynamic Window Approach) are popular."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Recovery Behaviors"}),": If the robot gets stuck or encounters an unexpected situation (e.g., a new obstacle blocking its path), recovery behaviors (e.g., rotating in place, backing up) are triggered to try and resolve the situation."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Task Executor"}),": Orchestrates the entire navigation process, managing the global and local planners, recovery behaviors, and monitoring goal progress."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Path Planning Process"}),":"]}),"\n",(0,a.jsxs)(n.ol,{children:["\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Goal Setting"}),": A user or higher-level AI sends a goal pose to Nav2."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Global Path Planning"}),": The global planner generates an initial path from the robot's current (localized) position to the goal, avoiding known obstacles in the static map."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Local Path Planning/Execution"}),": The local planner continuously generates commands (linear and angular velocities) for the robot to follow the global path, adapting to dynamic obstacles detected by sensors in real-time."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Feedback and Monitoring"}),": Sensor data continuously updates the robot's world model, and localization constantly refines its estimated pose."]}),"\n",(0,a.jsxs)(n.li,{children:[(0,a.jsx)(n.strong,{children:"Recovery"}),": If the robot deviates too much or encounters an unresolvable obstacle, recovery behaviors are activated."]}),"\n"]}),"\n",(0,a.jsxs)(n.p,{children:[(0,a.jsx)(n.strong,{children:"Hardware Considerations"}),": Nav2, being a ROS 2 stack, can run on various hardware. For mobile robots, including humanoids, deploying Nav2 on an edge computing platform like the ",(0,a.jsx)(n.strong,{children:"NVIDIA Jetson Orin Nano"})," allows for autonomous navigation capabilities directly on the robot. The GPU on the Orin Nano can accelerate certain perception tasks that feed into the world model (e.g., processing point clouds for obstacle detection) and potentially optimize parts of the planning algorithms. Complex simulations of Nav2 for multi-robot systems or in highly dynamic environments often benefit from the parallel processing power of a dedicated GPU like an ",(0,a.jsx)(n.strong,{children:"RTX 4070 Ti/4090"}),"."]}),"\n",(0,a.jsx)(n.p,{children:'Nav2\'s modularity and configurable nature make it adaptable to a wide range of robot platforms and navigation challenges, forming a crucial "brain" component for many Physical AI systems.'})]})}function h(e={}){const{wrapper:n}={...(0,o.R)(),...e.components};return n?(0,a.jsx)(n,{...e,children:(0,a.jsx)(d,{...e})}):d(e)}},8453:(e,n,i)=>{i.d(n,{R:()=>s,x:()=>r});var t=i(6540);const a={},o=t.createContext(a);function s(e){const n=t.useContext(o);return t.useMemo(function(){return"function"==typeof e?e(n):{...n,...e}},[n,e])}function r(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(a):e.components||a:s(e.components),t.createElement(o.Provider,{value:n},e.children)}}}]);